window.addEventListener("load",function(){setInterval(function(){[].map.call(document.querySelectorAll("[data-ng-include]"),function(b){if("true"!=b.dataset.loaded){var a=new XMLHttpRequest;a.onreadystatechange=function(){4==a.readyState&&200==a.status&&(b.dataset.loaded="true",b.innerHTML=a.responseText)};a.open("GET",b.dataset.ngInclude.replace(/'/g,""),!0);a.send()}})},500)});
